import { css, keyframes } from "goober";

import React from "react";

const grow = keyframes`
  0%, 100% {
    transform: scaleY(1);
  }

  50% {
    transform: scaleY(2);
  }
`;

export interface BarWaveProps {
  className?: string;
  color?: string;
  width?: number | string;
  height?: number | string;
  style?: React.CSSProperties;
  duration?: string;
}

const BarWave: React.FC<BarWaveProps & React.HTMLProps<HTMLDivElement>> = ({
  className = "",
  color = "#0d6efd",
  width = "2rem",
  height = "1rem",
  style = {},
  duration = "1s",
  ...others
}) => {
  let resolvedWidth = typeof width === "number" ? `${width}px` : width;
  let resolvedHeight = typeof height === "number" ? `${height}px` : height;

  return (
    <div
      {...others}
      style={style}
      className={
        css`
          display: flex;
          flex-flow: row nowrap;
          align-items: center;
          justify-content: space-between;
          width: ${resolvedWidth};

          & span {
            width: calc(${resolvedWidth} / 4 * 3 / 4);
            height: ${resolvedHeight};
            background-color: ${color};
          }

          & span:nth-of-type(1) {
            animation: ${grow} ${duration} -0.45s ease-in-out infinite;
          }

          & span:nth-of-type(2) {
            animation: ${grow} ${duration} -0.3s ease-in-out infinite;
          }

          & span:nth-of-type(3) {
            animation: ${grow} ${duration} -0.15s ease-in-out infinite;
          }

          & span:nth-of-type(4) {
            animation: ${grow} ${duration} ease-in-out infinite;
          }
        ` + ` ${className}`
      }
    >
      <span></span>
      <span></span>
      <span></span>
      <span></span>
    </div>
  );
};

export default BarWave;
import { css, keyframes } from "goober";

import React from "react";

const leftSwing = keyframes`
  50%,
  100% {
    transform: translateX(0);
  }
`;

const rightSwing = keyframes`
  50% {
    transform: translateX(0);
  }
  100% {
    transform: translateX(100%);
  }
`;

export interface BouncingBallsProps {
  className?: string;
  color?: string;
  width?: number | string;
  height?: number | string;
  style?: React.CSSProperties;
  duration?: string;
}

const BouncingBalls: React.FC<BouncingBallsProps & React.HTMLProps<HTMLDivElement>> = ({
  className = "",
  color = "#0d6efd",
  width = "3rem",
  height = "1rem",
  style = {},
  duration = "0.5s",
  ...others
}) => {
  let resolvedWidth = typeof width === "number" ? `${width}px` : width;
  let resolvedHeight = typeof height === "number" ? `${height}px` : height;

  return (
    <div
      {...others}
      style={style}
      className={
        css`
          display: inline-flex;
          flex-flow: row nowrap;
          align-items: center;
          justify-content: space-between;
          width: ${resolvedWidth};

          & div {
            width: calc(${resolvedWidth} / 3);
            height: ${resolvedHeight};
            border-radius: 50%;
            background-color: ${color};
          }

          & div:nth-of-type(1) {
            transform: translateX(-100%);
            animation: ${leftSwing} ${duration} ease-in alternate infinite;
          }

          & div:nth-of-type(3) {
            transform: translateX(0);
            animation: ${rightSwing} ${duration} ease-out alternate infinite;
          }
        ` + ` ${className}`
      }
    >
      <div></div>
      <div></div>
      <div></div>
    </div>
  );
};

export default BouncingBalls;
import { css, keyframes } from "goober";

import React from "react";

const rotate = keyframes`
  100% {
    transform: rotate(360deg);
  }
`;

const dash = keyframes`
  0% {
    stroke-dasharray: 1, 200;
    stroke-dashoffset: 0;
  }
  50% {
    stroke-dasharray: 90, 200;
    stroke-dashoffset: -35px;
  }
  100% {
    stroke-dashoffset: -125px;
  }
`;

export interface CircularProgressProps {
  className?: string;
  color?: string;
  width?: number | string;
  height?: number | string;
  style?: React.CSSProperties;
  duration?: string;
}

const CircularProgress: React.FC<CircularProgressProps & React.SVGProps<SVGSVGElement>> = ({
  className = "",
  color = "#0d6efd",
  width = "3rem",
  height = "3rem",
  style = {},
  duration = "2s",
  ...others
}) => {
  let resolvedWidth = typeof width === "number" ? `${width}px` : width;
  let resolvedHeight = typeof height === "number" ? `${height}px` : height;

  return (
    <svg
      {...others}
      crossOrigin="anonymous"
      viewBox="25 25 50 50"
      style={style}
      className={
        css`
          width: ${resolvedWidth};
          height: ${resolvedHeight};
          transform-origin: center;
          animation: ${rotate} ${duration} linear infinite;
        ` + ` ${className}`
      }
    >
      <circle
        className={css`
          fill: none;
          stroke: ${color};
          stroke-width: 3;
          stroke-dasharray: 1, 200;
          stroke-dashoffset: 0;
          stroke-linecap: round;
          animation: ${dash} calc(${duration} * 3 / 4) ease-in-out infinite;
        `}
        cx="50"
        cy="50"
        r="20"
      ></circle>
    </svg>
  );
};

export default CircularProgress;
import { css, keyframes } from "goober";

import React from "react";

const spin = keyframes`
  to {
    transform: rotateY(540deg);
  }
`;

export interface CoinProps {
  className?: string;
  color?: string;
  width?: number | string;
  height?: number | string;
  style?: React.CSSProperties;
  duration?: string;
}

const Coin: React.FC<CoinProps & React.HTMLProps<HTMLDivElement>> = ({
  className = "",
  color = "#0d6efd",
  width = "2rem",
  height = "2rem",
  style = {},
  duration = "1.2s",
  ...others
}) => {
  let resolvedWidth = typeof width === "number" ? `${width}px` : width;
  let resolvedHeight = typeof height === "number" ? `${height}px` : height;

  return (
    <div
      {...others}
      style={style}
      className={
        css`
          perspective: 9999px;
        ` + ` ${className}`
      }
    >
      <div
        className={css`
          width: ${resolvedWidth};
          height: ${resolvedHeight};
          border-radius: 50%;
          border: calc(${resolvedWidth} / 8) solid ${color};
          animation: ${spin} ${duration} ease-in-out infinite;
        `}
      ></div>
    </div>
  );
};

export default Coin;
import { css, keyframes } from "goober";

import React from "react";

const fade = keyframes`
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
`;

export interface FadingBallsProps {
  className?: string;
  color?: string;
  width?: number | string;
  height?: number | string;
  style?: React.CSSProperties;
  duration?: string;
}

const FadingBalls: React.FC<FadingBallsProps & React.HTMLProps<HTMLDivElement>> = ({
  className = "",
  color = "#0d6efd",
  width = "4rem",
  height = "1rem",
  style = {},
  duration = "0.8s",
  ...others
}) => {
  let resolvedWidth = typeof width === "number" ? `${width}px` : width;
  let resolvedHeight = typeof height === "number" ? `${height}px` : height;

  return (
    <div
      {...others}
      style={style}
      className={
        css`
          width: ${resolvedWidth};
          display: flex;
          flex-flow: row nowrap;
          align-items: center;
          justify-content: space-between;

          & div {
            width: calc(${resolvedWidth} / 4);
            height: ${resolvedHeight};
            border-radius: 50%;
            background-color: ${color};
            animation: ${fade} ${duration} ease-in-out alternate infinite;
          }

          & div:nth-of-type(1) {
            animation-delay: calc(${duration} * -0.5);
          }

          & div:nth-of-type(2) {
            animation-delay: calc(${duration} * -0.25);
          }
        ` + ` ${className}`
      }
