          width: ${resolvedWidth};
          height: ${resolvedHeight};
          border: 3px solid ${color};
          overflow: hidden;
          animation: ${spin} ${duration} ease infinite;

          &::before {
            content: "";
            position: absolute;
            top: -3px;
            left: -3px;
            width: calc(100% + 3px);
            height: calc(100% + 3px);
            background-color: ${color};
            opacity: 0.75;
            transform-origin: center bottom;
            transform: scaleY(1);
            animation: ${fill} ${duration} linear infinite;
          }
        ` + ` ${className}`
